import './App.css';
import React, { useState, useEffect, useRef } from 'react';
import {BrowserRouter as Router,Routes,Route} from 'react-router-dom';
import Header from "./components/Header";
import Home from "./views/Home";
import Menu from "./components/Menu";
import AddExcercise from './views/AddExcercise';
import AddAthlete from './views/AddAthlete';
import Timer from './views/Timer';
import Login from "./views/Login"
import MenuContext from './context/MenuContext';

function App() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const hamburgerRef = useRef(null); 


  const toggleMenu = () => {
    setIsMenuOpen(prevState => !prevState);
  };


  return (
    <div className="App">
      <Router>
      <Routes>
        <MenuContext>
      <Route path="/" element={<Home isOpen={isMenuOpen}/>}/>
      <Route path="add-excercise" element={<AddExcercise isOpen={isMenuOpen}/>} />
      <Route path="add-athlete" element={<AddAthlete isOpen={isMenuOpen}/>} />
      <Route path="timer" element={<Timer isOpen={isMenuOpen}/>} />
      <Route path="login" element={<Login/>} />
        </MenuContext>
      </Routes>
      </Router>
    </div>
  );
}

export default App;
